import styled from "@emotion/styled";

const Container = styled.div`
  height: 50rem;
  flex: 1;
  background: white;
  h1 {
    text-align: center;
  }
`;

const Title = styled.h1`
  text-align: center;
`;

export const CategoryList = () => {
  return (
    <>
      <Title>Catagories</Title>
      <Container></Container>
    </>
  );
};
